import React from "react";
import s from './DogCard.css';

export default function DogCard({name, image, temperament, weight_min, weight_max }){
    return (
        <div className="cards">
            <div className="flip-card">
                <div className="flip-card-inner">
                    <div className="flip-card-front">
                        <h1>{`${name}`}</h1>
                        <img src={image} alt='' width="250px" height="190px" className="imageDog" />
                    </div>
                    <div>
                        <h2>Temperamento:</h2>
                        
                        <h4>{function (temperament) {
                            if (typeof (temperament) === 'string') {
                                return temperament
                            }
                            if (Array.isArray(temperament)) {
                                let temps = temperament.map(e => e.name)
                                return temps.join(', ')
                            }
                        }(temperament)}</h4>

                    

                        <h2>Peso:</h2>
                        <h4>De {weight_min} Kg. a {weight_max} Kg.</h4>
                        </div>
                        </div>
                    </div>
                    </div>
                
    )
}
